  //////////////////////////////////////////////////////////////////\n
  // Command URL functions\n
  //////////////////////////////////////////////////////////////////\n
  function routeMethodLess() {\n
    // Nothing. Go to front page\n
    return synchronousChangeState(\n
      getDisplayUrlFor(undefined, {page: DEFAULT_PAGE})\n
    );\n
  }\n
